void RandomPresetPlugin::onLoad() {
    // Generate a random index into the string list
    int randomIndex = rand() % stringList.size();

    // Construct the console command with the chosen string
    string consoleCommand = "cl_itemmod_code " + stringList[randomIndex];

    // Get the wrapper for the console variable
    CVarWrapper cvarWrapper = cvarManager->getCvar("cl_itemmod_code");

    // Set the value of the console variable to the chosen string
    cvarWrapper.setValue(stringList[randomIndex]);
}

void RandomPresetPlugin::unLoad() {

    CVarWrapper cvarWrapper = cvarManager->getCvar("cl_itemmod_enabled");

    // Set the value of the console variable to 0
    cvarWrapper.setValue(0);
}

